import * as React from 'react';
import { styled } from '@mui/material/styles';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import ChillImage from "../images/chilldood.svg";

const Item = styled(Paper)(({ theme }) => ({
  textAlign: 'center',
}));

function Chill() {
  // Import result is the URL of your image
  return <img src={ChillImage} alt="Dood Chills" />;
}

export default function BasicGrid() {
  return (
      <Grid container spacing={2} style={{ height: "auto", display: "flex", backgroundColor: "#384885", padding: "40px"}}>
        <Grid item xs={ 12 } md= {6}>
          <Item elevation={2} style={{backgroundColor: "#24305e", color: "#ffffff", minHeight:"600px", padding: "40px"}}>
            <h1 style={{ display: "flex", justifyContent: "left",}}>Welcome </h1>
            <h2 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}> The Good Doods Club is for Good Doods who want to Do Good. Our initial Do Good Project will generate ~$11m for cancer research and over 5000 gifts for children at St Judes.</h2>
            <h2 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}> Our Do Good Model will perpetually fund gift giving and we will expand our approach to help make life better here on earth.</h2>
            <h2 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}>The HED will be able to direct 50,000 SOL to causes they believe in.</h2>
            <h1 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}>5,000 Good Dood Members </h1>
            <h1 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}>25 SOL Club Membership Fee </h1>
            <h1 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}>50% of each mint enters into the Do Good Project Wallet</h1>
            <h1 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}>25% of each mint enters the Member Rewards Wallet </h1>
            <h1 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}>25% of each mint enters the  Organizers Wallet</h1>
            <h1 style={{ display: "flex", justifyContent: "left", textAlign: "justify"}}>5% Organizer resale commission</h1>
          </Item>
        </Grid>
        <Grid item xs={12} md={6}>
          <Item elevation={0}  style={{backgroundColor: "#384885"}}>

          <img src={ChillImage} alt="Logo"
            style={{
              maxWidth: "100%",
              minWidth: "300px",
              height: "auto",
              marginLeft: "20px",
          }}
          />

          </Item>
        </Grid>
      </Grid>
  );
}
